import React, {useState} from 'react';
import axios from "axios";

const Dev =  () => {
  const [todos, setTodos] = useState<any>([]);

  const users = () => {
    axios.get('https://jsonplaceholder.typicode.com/users').then((res) => {
      setTodos(res.data)
    })
  }

  return (
    <React.Fragment>
      <main>
          {todos.map((aaa) => (
            <p>{aaa.title}</p>
          ))}
      </main>
    </React.Fragment>
  );
}

export default Dev;
